import "../css/Game.css";
import Help from "./Help";
import TetrisHeader from "./TetrisHeader";


const Game = () => {
    return(
        <div className="Game">
            <TetrisHeader />
            <div className="Tetris-home">
                <Help />

                <div>
                    <button>Single Play</button>
                    <button>Multi Play</button>
                </div>
            </div>
        </div>
    )
}
export default Game;
